import React, { useState } from "react";
import { Link } from "react-router-dom";

const Profile = () => {
  const [showBar, setShowBar] = useState(false);

  const showSidebarContent = () => {
    if (showBar === false) {
      const element = document.getElementById("sidebar");
      element.style.width = "15vw";
      const element1 = document.getElementById("content");
      element1.style.width = "85vw";
      element1.style.marginLeft = "12rem";
      const element2 = document.getElementById("icon");
      element2.style.justifyContent = "end";
      setShowBar(true);
      const elements = document.getElementsByClassName("link");
      Array.from(elements).forEach((element) => {
        element.style.display = "block";
      });
    } else {
      const element = document.getElementById("sidebar");
      element.style.width = "5vw";
      const element1 = document.getElementById("content");
      element1.style.width = "95vw";
      element1.style.marginLeft = "1rem";
      const element2 = document.getElementById("icon");
      element2.style.justifyContent = "center";
      const elements = document.getElementsByClassName("link");
      Array.from(elements).forEach((element) => {
        element.style.display = "none";
      });
      setShowBar(false);
    }
  };

  return (
    <>
      <section id="sidebar">
        <div className="container">
          <div className="row">
            <div className="col-12 mt-3 mb-3">
              <i
                id="icon"
                class="fa-solid fa-grip-lines text-white"
                onClick={showSidebarContent}
              ></i>
            </div>
            <div className="col-12 mb-3 text-center">
              <img src={process.env.PUBLIC_URL + "/images/default_profile.png"} alt="Profile" className="rounded-circle" />
              <h3>Name</h3>
            </div>
            <div className="col-12 mb-3">
              <ul className="list-unstyled">
                <li>
                  <i class="fa-solid fa-house text-white active">
                    <Link to="/" className="link">
                      Dashboard
                    </Link>
                  </i>
                </li>
                <li>
                  <i class="fa-solid fa-user">
                    <Link to="/" className="link">
                      Profile
                    </Link>
                  </i>
                </li>
                <li>
                  <i class="fa-solid fa-book">
                    <Link to="/" className="link">
                      Booking
                    </Link>
                  </i>
                </li>
              </ul>
            </div>
            <div className="col-12 logout">
              <ul className="text-center list-unstyled">
                <li>
                  <i class="fa-solid fa-arrow-right-from-bracket">
                    <Link to="/" className="link">
                      Logout
                    </Link>
                  </i>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </section>
      <section id="profile">
        <div className="container">
            <div className="row">
                <div className="col-12">
                    <h4>Profile</h4>
                </div>
                <div className="col-12">
                    <form action="">
                        <img src={process.env.PUBLIC_URL + "/images/default"} alt="" />
                        <input type="text" />
                        <label htmlFor="">Name</label>
                        <input type="text" />
                        <label htmlFor="">Email</label>
                        <input type="text" />
                        <label htmlFor="">Address</label>
                        <input type="text" />
                        <label htmlFor="">Phone Number</label>
                    </form>
                    <div className="col-6">
                        
                    </div>
                </div>
            </div>
        </div>
      </section>
    </>
  );
};

export default Profile;
